import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [s3Contents, setS3Contents] = useState([]);
  const [predictions, setPredictions] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      // Fetch S3 contents
      const s3Response = await fetch('http://localhost:5000/api/s3-contents');
      const s3Data = await s3Response.json();
      setS3Contents(s3Data);

      // Fetch predictions
      const predictionsResponse = await fetch('http://localhost:5000/api/predictions');
      const predictionsData = await predictionsResponse.json();
      setPredictions(predictionsData);
    } catch (error) {
      console.error('Error fetching data:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Cloud Project Dashboard</h1>
      </header>

      <main>
        {loading ? (
          <p>Loading...</p>
        ) : (
          <div className="dashboard">
            <section className="s3-section">
              <h2>S3 Bucket Contents</h2>
              <ul>
                {s3Contents.map((item, index) => (
                  <li key={index}>{item.Key}</li>
                ))}
              </ul>
            </section>

            <section className="predictions-section">
              <h2>Databricks Predictions</h2>
              <ul>
                {predictions.map((prediction, index) => (
                  <li key={index}>{JSON.stringify(prediction)}</li>
                ))}
              </ul>
            </section>
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
